//680. 验证回文字符串 Ⅱ
//		给定一个非空字符串 s，最多删除一个字符。判断是否能成为回文字符串。
//
//		示例 1:
//
//		输入: "aba"
//		输出: True
//		示例 2:
//
//		输入: "abca"
//		输出: True
//		解释: 你可以删除c字符。
//		注意:
//
//		字符串只包含从 a-z 的小写字母。字符串的最大长度是50000。
public class ValidPalindrome_680 {

	public static void main(String[] args) {
		System.out.println(validPalindrome("aba"));
		System.out.println(validPalindrome("abccca"));
		System.out.println(validPalindrome(""));
		System.out.println(validPalindrome(""));
	}

//	判断回文串显然是用双指针的，i从前往后遍历，j从后往前遍历。难点就是怎么去判断删除一个元素后的字符串是不是回文串，我提供一个思路：
//
//	以"abdda"这个串为例，此时i指向'b'，j指向'd'，发现不对了。但是有一次删除的机会，我们自己写几个case其实就能发现，此时子串范围为(i+1, j)或(i, j-1)的俩子串只要有任意一个是回文串，则结果就是回文串，否则就不是。
	public static boolean validPalindrome(String s) {
		int i=0,j=s.length()-1;
		while (i<j){
			if(s.charAt(i) != s.charAt(j)){
				return validString(s,i+1,j) || validString(s,i,j-1);
			}
			i++;
			j--;
		}
		return true;
	}

	private static boolean validString(String s,int i,int j){
		while (i<j){
			if(s.charAt(i) != s.charAt(j)){
				return false;
			}
			i++;
			j--;
		}
		return true;
	}
}
